import React from "react";
import { Link } from "react-router-dom";
import "./App.css";

function HomePage() {
  return (
    <div className="homepage">
      {/* Background Video */}
      <video autoPlay loop muted className="background-video">
        <source src="/stars-background.mp4" type="video/mp4" />
        {/* Add a fallback message in case video doesn't load */}
        Your browser does not support the video tag.
      </video>

      {/* Overlay with navbar and description */}
      <div className="overlay">
        {/* Navigation Bar */}
        <nav className="navbar">
          <ul>
            <li><Link to="/apod">APOD</Link></li>
            <li><Link to="/mars-photos">Mars Photos</Link></li>
            <li><Link to="/epic-images">EPIC Images</Link></li>
            <li><Link to="/neo">Near Earth Objects</Link></li>
            <li><Link to="/nasa-library">NASA Library</Link></li>
          </ul>
        </nav>

        {/* Description Section */}
        <div className="description">
          <h1>NASA Data Explorer</h1>
          <p>
            Discover the wonders of the universe using NASA's vast array of data. Explore the Astronomy Picture of the Day, Mars Rover Photos, EPIC images, and much more.
          </p>
        </div>
      </div>
    </div>
  );
}

export default HomePage;
